- input: "TEXT\x1CC00305052\x1C.TEXT\x1C\x1CF3A\x1CThe Walter Jones Committee takes
    great care to ensure that all contributions are designated properly. The donors
    referenced in your January 31, 2011 letter were resolved as follows: 1) Mr. Bayliss'
    donation was received during the Primary 2012 election period and was undesignated.
    Because the postmarked envelope was not saved to show the made date, the designation
    has been amended to show the correct election designation. 2) The donation received
    from the American Hospital Association Political Action Committee was received
    during the Primary 2012 election period and had a designation for the general
    2010 election. Because the postmarked envelope was not saved to show the made
    date, this contribution was refunded on February 21, 2011.\n"
